package issubsequence

import (
	"fmt"
	"testing"
)

type in struct {
	s, t string
}

type Case struct {
	in   in
	want bool
}

var cases = []Case{
	{in: in{s: "abc", t: "ahbgdc"}, want: true},
	{in: in{s: "axc", t: "ahbgdc"}, want: false},
	{in: in{s: "acb", t: "ahbgdc"}, want: false},
	{in: in{s: "leeeeetcode", t: ""}, want: true},
	{in: in{s: "b", t: "c"}, want: false},
}

func TestIsSubsequence(t *testing.T) {
	for i, c := range cases {
		t.Run(fmt.Sprint(i), func(t *testing.T) {
			got := isSubsequence(c.in.s, c.in.t)
			if got != c.want {
				t.Errorf("in: %+v, got: %t, want: %t", c.in, got, c.want)
			}
		})
	}
}
